import React, { Component } from 'react';
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavbarToggler,
  MDBCollapse,
  MDBContainer
} from 'mdbreact';
import { Switch, Route, Link } from 'react-router-dom'
import { BrowserRouter as Router } from 'react-router-dom';
import { translate } from "react-i18next";

import './mobile-navbar.css';


class MobileNavbar extends Component {
  state = {
    collapseID: ''
  };

  toggleCollapse = collapseID => () => {
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ''
    }));
  };

  render() {
    const { t } = this.props;

    return (
      <div className="mobile-nav__container">
        <Router>
          <MDBContainer>
            <MDBNavbar light className="mobile-nav__mdbnavbar">
              <MDBContainer>
                <MDBNavbarBrand>
                  <img src="/assets/logo-cci.svg" alt="Circle CI Logo" />
                </MDBNavbarBrand>
                <MDBNavbarToggler
                  onClick={this.toggleCollapse('navbarCollapse1')}
                />
                <MDBCollapse
                  id='navbarCollapse1'
                  isOpen={this.state.collapseID}
                  navbar
                >
                  <MDBNavbarNav left>
                    <MDBNavItem active>
                      <Link to="/beetroots/" tabIndex='1'>Beetroots</Link>
                    </MDBNavItem>
                    <MDBNavItem>
                      <Link to="/horseraddish/" tabIndex='2'>Horseraddish</Link>
                    </MDBNavItem>
                    <MDBNavItem>
                      <Link to="/sea-lettuce/" tabIndex='3'>Sea lettuce</Link>
                    </MDBNavItem>
                    <MDBNavItem>
                      <Link to="/start-building/" tabIndex='4'>{ t('startBuilding', { framework: "react-i18next" }) }</Link>
                    </MDBNavItem>
                    <Switch>
                      <Route path='/beetroots' />
                      <Route path='/horseraddish' />
                      <Route path='/sea-lettuce' />
                      <Route path='/start-building' />
                    </Switch>
                  </MDBNavbarNav>
                </MDBCollapse>
              </MDBContainer>
            </MDBNavbar>
          </MDBContainer>
        </Router>
      </div>
    );
  }
}

export default translate('common')(MobileNavbar);
